import React from "react";

function PreHomePage() {
  const homePageFunction = () => {
    window.location.href = "HomePage.html";
  };

  const signInFunction = () => {
    window.location.href = "U1_SignIn.html";
  };

  return (
    <div>
      <img
        src="https://sv1.picz.in.th/images/2023/06/06/I09RmQ.png"
        alt="LookkaingernLogo"
        width="500"
        height="400"
        className="center-block"
      />

      <h4 className="font-main" colSpan="6" style={{ textAlign: "center" }}>
        <b>Welcome to our restaurant</b>
      </h4>

      <div className="button-group">
        <button onClick={homePageFunction} className="button-homepage">
          Home page
        </button>
        <button onClick={signInFunction} className="button-signin">
          Sign in
        </button>
      </div>

      <div className="font-main">
        <b>Already a member? If not</b>&nbsp;
        <a href="U1_SignUp.html">Sign up</a>
      </div>
    </div>
  );
}

export default PreHomePage;
